function Header() {
	return (
		<Wrapper>
			<ul>
				<li>+7 701 135 41 46</li>
				<li>+7 775 656 48 27</li>
				<li>WhatsApp</li>
				<li>Дисконтная система</li>
				<li>Доставка и оплата</li>
				<li>FAQ</li>
			</ul>
		</Wrapper>
	);
}

const Wrapper = styled.header``

export default Header;
